import React, {useEffect, useState} from "react";
import {useNavigate} from "react-router-dom";
import { useDispatch } from "react-redux";
import {userPhone} from "../../pages/reducers/userInfo";

interface Props{
    code : string,
    inputCode : string,
    isCode : boolean,
    cell : string,
    check : boolean,
    setStep : React.Dispatch<React.SetStateAction<string>>
}
const ConfirmButton = (props : { setStep : React.Dispatch<React.SetStateAction<string>> }) => {

    return (
        <div className='fixed bottom-0 w-full  bg-white flex justify-center h-[80px] py-8'>
            <button className='button_on py-8' onClick={(e: React.MouseEvent<HTMLElement>) => props.setStep('step1')} >닫기</button>
        </div>
    )
}
export default ConfirmButton;
